webpackJsonp([0x81b8806e4260],{335:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Django Meets Blockchain",sidebarTitle:"Django Meets Blockchain",sidebarSubtext:"Django Meets Blockchain",siteLastUpdated:"2018-12-13T12:27:18.477Z",description:"Documentation for Django Meets Blockchain",version:"1.0",siteUrl:"https://taliotech.github.io/django-meets-blockchain-site",keywords:"talio,blockchain,django",author:{name:"Talio.io",url:"https://talio.ai",email:"info@talio.io"},socials:[{name:"Twitter",imgpath:"icon-twitter.svg",url:"TODO"},{name:"GitHub",imgpath:"icon-github.svg",url:"https://github.com/taliotech/django-meets-blockchain-site"},{name:"LinkedIn",imgpath:"icon-linkedin.svg",url:"TODO"},{name:"Medium",imgpath:"icon-medium.svg",url:"TODO"}]}},markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-top: 1.5rem; margin-bottom: 1.5rem; max-width: 720px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 50%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="event-logo"\n        title=""\n        src="/django-meets-blockchain-site/static/event-logo-3dfb1d5185a2e1b3b2b9f45ea46a04e8-45c6a.jpg"\n        srcset="/django-meets-blockchain-site/static/event-logo-3dfb1d5185a2e1b3b2b9f45ea46a04e8-f7717.jpg 180w,\n/django-meets-blockchain-site/static/event-logo-3dfb1d5185a2e1b3b2b9f45ea46a04e8-9ac32.jpg 360w,\n/django-meets-blockchain-site/static/event-logo-3dfb1d5185a2e1b3b2b9f45ea46a04e8-45c6a.jpg 720w,\n/django-meets-blockchain-site/static/event-logo-3dfb1d5185a2e1b3b2b9f45ea46a04e8-5de85.jpg 800w"\n        sizes="(max-width: 720px) 100vw, 720px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Want to learn how easy it is to craft modern JSON-based APIs using Django REST Framework but can’t seem to find the time? Eager to dive into the emerging world of smart contracts and building on top of the Ethereum blockchain but don’t know where to start?</p>\n<p>Join Rev1, SafeChain and Talio for a FREE, intensive, 3-hour bootcamp that will have you build a live RESTful API using Django REST Framework, run your first transaction on the Ethereum blockchain using Web3.js and, finally, prove your abilities in our final challenge by claiming your one-of-a-kind Ohio token.</p>\n<p>We’ll kick off the evening promptly at 6pm with a gentle introduction to models, routes and views in Django REST Framework and how to ease yourself into Python syntax (useful if you’re new or coming from another language such as .Net or Java.) You’ll then have an opportunity to dive right in to a live exercise to build your very first API endpoint on top of DRF with help from seasoned instructors and TAs from Talio.</p>\n<p>From there, SafeChain will give an overview of how they’re using Ethereum blockchain to make real estate transactions more secure, followed by a brief group discussion of other potential applications. Lastly, Talio instructors will give a brief crash course on the fundamentals of Web3.js and how to run a transaction on the blockchain, after which attendees will dive into their second lab exercise of the evening.</p>\n<p>Agenda</p>\n<ul>\n<li>5:45pm: Arrive, check in</li>\n<li>6:00pm: Introductions &#x26; A Gentle Introduction to Django+REST Framework</li>\n<li>6:30pm: RESTful API lab exercise</li>\n<li>7:30pm: A chat about blockchain and how it’s used at SafeChain</li>\n<li>8:00pm: Ethereum blockchain lab exercise and final challenge</li>\n<li>9:00pm: Close</li>\n</ul>\n<p>Presented by Rev1 Ventures, SafeChain and Talio Technology</p>\n<h4 id="about-rev1"><a href="#about-rev1" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>About Rev1</h4>\n<p>Rev1 Ventures is an investor startup studio that combines capital and strategic services to help startups scale and corporates innovate. Based in the Midwest, and in a top city for scaling startups, Rev1 aligns innovators and founders with corporate and research partners to access customers and markets, helping entrepreneurs build great companies. With a proven track record of identifying, guiding, and investing in high potential startups, Rev1 helps companies solve real problems for markets in need of real solutions. Rev1 has ~$90MM in capital under management, providing a capital continuum from corporate and community partners, as well as Ohio Third Frontier. Rev1 has been named among the Most Active VCs in the Great Lakes Region for the past four years in a row according to PitchBook. For more information, visit www.rev1ventures.com.</p>\n<h4 id="about-safechain"><a href="#about-safechain" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>About SafeChain</h4>\n<p>SafeChain leverages advanced software technologies including blockchain to increase the speed and security of real estate property transactions. As the winner of 2018 VentureOhio Seed Startup of the Year, SafeChain was instrumental in Columbus Ohio being named #1 Rising Cities For Startups by Forbes.</p>\n<h4 id="about-talio"><a href="#about-talio" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>About Talio</h4>\n<p>Talio works with the world’s most innovative companies to develop and deliver high-intensity technical onboarding and upskilling bootcamps, workshops and learning events. Each program is fully customized specifically around a team’s goals, tech stack and culture and we run the event live at the location of our client’s choosing, either on-demand or on a recurring basis.</p>',excerpt:"Want to learn how easy it is to craft modern JSON-based APIs using Django REST Framework but can’t seem to find the time? Eager to dive into…",frontmatter:{id:"index",title:"Welcome to Django Meets Blockchain!",prev:null,next:null}}},pathContext:{slug:"/"}}}});
